import React from "react";
import "../Components/WheelPage.css";
import img1 from "../Images/wheels.png";
import img2 from "../Images/gift.png";

function WheelPage() {
  return <div>
    <img src={img1} alt="wheel-game" />
    <img src={img2} alt="head" />
  </div>;
}

export default WheelPage;
